char str[N];
void exgcd(ll a, ll b, ll &x, ll &y) {
    if(!b){
        x = 1; y = 0;
    }else{
        exgcd(b, a%b, y, x);
        y -= x*(a/b);
    }
}    
ll inv(ll a, ll n) {
    ll x, y;
    exgcd(a, n, x, y);
    return (x+n)%n;
}   
ll pow_mod(ll x, ll n, ll mod){  
    ll res=1;  
    while(n>0){  
        if(n&1)res=res*x%mod;  
        x=x*x%mod;  
        n>>=1;  
    }  
    return res;  
} 
